import React from 'react';
import "./css/Startseite.css";

class Home extends React.Component {
	render() {
		return (
			<>
				<div className='homescreen_buttons'>
					<button onClick={event => window.location.href = '/Host'} >Einen neuen Raum erstellen</button>
					<button onClick={event => window.location.href = '/Room'} >Einen vorhanden Raum beitreten</button>
				</div>


			</>
		);
	};
}
export default Home;
